import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.sass';

function App() {
  return (
    <Router>
        <Switch>
          <Route path="/account">
            {/* <About /> */}
          </Route>
          <Route path="/login">
            {/* <Users /> */}
          </Route>
          <Route path="/">
            {/* <Home /> */}
          </Route>
        </Switch>
    </Router>
  );
}

export default App;
